PRINT 'Deleting of SocialNetwork, SocialNetworkExtras, SocialNetworkExtrasXCampaign, and SocialNetworkXCampaign all data with IdSocialNetwork Greater than 24 (All values that are not defaults)'
IF EXISTS 
	(SELECT * FROM [dbo].[Campaign] WHERE
		IdParentCampaign IS NOT NULL
		AND UTCCreationDate < '2012/06/08 16:00:00' and UTCCreationDate > '2012/06/07')
BEGIN
	DELETE FROM [dbo].[SocialNetworkShareXCampaign] WHERE IdSocialNetwork > 24
	DELETE FROM [dbo].[SocialNetwork] WHERE IdSocialNetwork > 24
	DELETE FROM [dbo].[SocialNetworkExtrasXCampaign] where IdExtra > 4
	DELETE FROM [dbo].[SocialNetworkExtras] WHERE IdExtra > 4
END

PRINT 'Resolve CountriesWidthoutState'
INSERT INTO [State] (Name,IdCountry, CountryCode)
SELECT c.Name,c.IdCountry, c.Code
FROM Country c LEFT JOIN [State] s ON c.IdCountry=s.IdCountry
WHERE s.IdCountry IS NULL

